import React, { useEffect } from "react";
import "./About.css";
import Navbar from "./Navbar";
import gsap from "gsap";

const About = () => {
  useEffect(() => {
    // Hero section animation
    gsap.from(".about-hero-content", {
      opacity: 0,
      y: 50,
      duration: 1.5,
      ease: "power2.out",
    });
  }, []);

  const deepaData = {
    introduction: `
      Hi, I am a licensed architect with a passion for creating meaningful
      architectural solutions. I believe in harmony between context, built
      form, and users, and my research delves into how space impacts human
      behavior and mental well-being.
    `,
    experience: [
      "NASA India: Design and Editorial Team (2020 - 2021)",
      "Statice Media: Graphic Designer (2021)",
      "Crest Architects: Intern Architect (2022 - 2023)",
    ],
    education: [
      "Vidhya Vardhaka Sangha, Bengaluru (Grade 10, 2004 - 2016)",
      "KLE Societyâ€™s S Nijalingappa College, Bengaluru (Grade 11-12, 2016 - 2018)",
      "School of Architecture, Ramaiah Institute of Technology (Bachelors in Architecture, 2018 - 2023)",
    ],
    skills: {
      hardSkills: [
        "AutoCAD",
        "SketchUp",
        "Adobe Photoshop",
        "Adobe Illustrator",
        "Model Making",
        "Motion Graphics",
      ],
      softSkills: ["Teamwork", "Leadership", "Time Management", "Public Speaking"],
    },
    languages: ["Kannada", "English", "Hindi"],
  };

  return (
    <>
      <header className="about-hero">
        <Navbar />
        <div className="about-hero-content">
          <p className="about-hero-intro">Hi, I'M</p>
          <h1 className="about-hero-title">Deepa Devangmath</h1>
        </div>
        <div className="about-hero-image"></div>
      </header>

      <main className="about-main">
        {/* Introduction Section */}
        <section className="about-introduction">
          <h2>Introduction</h2>
          <p>{deepaData.introduction}</p>
        </section>

        {/* Details Section */}
        <section className="about-details">
          <div className="about-section education">
            <h3>Education</h3>
            <ul>
              {deepaData.education.map((item, index) => (
                <li key={index}>{item}</li>
              ))}
            </ul>
          </div>

          <div className="about-section experience">
            <h3>Work Experience</h3>
            <ul>
              {deepaData.experience.map((item, index) => (
                <li key={index}>{item}</li>
              ))}
            </ul>
          </div>

          <div className="about-section skills">
            <h3>Skills</h3>
            <div className="skills-lists">
              <ul>
                <h4>Hard Skills</h4>
                {deepaData.skills.hardSkills.map((skill, index) => (
                  <li key={index}>{skill}</li>
                ))}
              </ul>
              <ul>
                <h4>Soft Skills</h4>
                {deepaData.skills.softSkills.map((skill, index) => (
                  <li key={index}>{skill}</li>
                ))}
              </ul>
            </div>
          </div>

          <div className="about-section languages">
            <h3>Languages</h3>
            <ul>
              {deepaData.languages.map((language, index) => (
                <li key={index}>{language}</li>
              ))}
            </ul>
          </div>
        </section>
      </main>
    </>
  );
};

export default About;
